#include <fstream>
#include <iostream>
#include <string>

using namespace std;

string code = "";

int main() {
    ofstream file("decode.txt");

    char c[1000][1000];
    for (int i = 0; i < 1000; i++) {
        for (int j = 0; j < 1000; j++) {
            c[i][j] = '.';
        }
    }

    int i = 717, j = 48;
    c[i][j] = '#';
    int k = 0;
    while (true) {
        if (code[k] == 'a') {
            c[--i][++j] = '#';
            k++;
        } else if (code[k] == 'b') {
            c[i][++j] = '#';
            k++;
        } else if (code[k] == 'c') {
            c[++i][++j] = '#';
            k++;
        } else if (code[k] == 'd') {
            c[++i][j] = '#';
            k++;
        } else if (code[k] == 'e') {
            c[++i][--j] = '#';
            k++;
        } else if (code[k] == 'f') {
            c[i][--j] = '#';
            k++;
        } else if (code[k] == 'g') {
            c[--i][--j] = '#';
            k++;
        } else if (code[k] == 'h') {
            c[--i][j] = '#';
            k++;
        } else
            break;
    }

    for (int a = 0; a < 1000; a++) {
        for (int b = 0; b < 1000; b++) {
            file << c[a][b];
        }
        file << '\n';
    }
}